import React from 'react';

const SavedFundsPage = () => {
  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Saved Funds</h2>
      <p>No funds saved yet.</p>
    </div>
  );
};

export default SavedFundsPage;
